import React from 'react';
import './Register.css'
import img from '../samples/register.png'
const Register = ()=> {
return(

    <>
     <div className="body"> 
     
     <div className="reg-pic">

     <img src={img}></img>
      </div>
     <div className="reg-number-plate">


     </div>
     </div>

    </>
)


}
export default Register;
